import React from 'react';
import Head from 'next/head';
import PropTypes from 'prop-types';
import AppLayout from '../components/AppLayout';

const FutChall = ({ Component }) => {
    return (
        <>
            <Head>
                <title>FutChall</title>
                <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/4.1.0/antd.min.css" />
                <script src="https://cdnjs.cloudflare.com/ajax/libs/antd/4.1.0/antd.min.js"></script>
                <script type="text/javascript" src="//dapi.kakao.com/v2/maps/sdk.js?appkey=60712c2e792d545d1241f9c9bc3a1f28&libraries=clusterer"></script>
            </Head>
            <AppLayout>
                <Component />
            </AppLayout>
        </>
    );
}
FutChall.propTypes = {
    Component: PropTypes.elementType,
};
export default FutChall;
